import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';

class MemberForm extends Component {
    render() {
        return (
            <div>
                <Container>
                    <Row><br /><br /></Row>
                    <Row>
                        <Col md={{size: 6, offset: 3}}>
                            <h1>Add New Member</h1>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default MemberForm;
